from algo_primitives.z_function import z_function

def all_occurences(pattern, text):
    patterned_text = pattern + '|' + text
    zfunc_result = z_function(patterned_text)
    additional_length = len(pattern) + 1
    return [index - additional_length for index, i in enumerate(zfunc_result) if i == len(pattern)]


if __name__ == '__main__':
    TEXT = ''
    PATTERN = 'CTTGATCAT'
    print(' '.join(map(str, all_occurences(PATTERN, TEXT))))

